                    "Content-Length": "72",
                    "Origin": "https:/status.wi-line.fr",
                    "Connection": "keep-alive",
                    "Referer": "https:/status.wi-line.fr/?id=65e4444c3471550a789e2138a9e28eff",
                    "Cookie": "_ga=GA1.2.2133996233.1637072634; PHPSESSID=k6jatejctvhmphaar76vcotff2; _gid=GA1.2.1409394663.1637940486",
                    "Sec-Fetch-Dest": "empty",
                    "Sec-Fetch-Mode": "cors",
                    "Sec-Fetch-Site": "same-origin"
                },
                params: {
                    'action': 'READ_LIST_STATUS',
                    'serial_centrale': '65e4444c3471550a789e2138a9e28eff'
                }
            }).then(response => {
                const data = response.data;
                console.log({data})
            })
            // ['machine_info_status']['machine_list']
        }
        loadData();
    })

    return <> </>;

}

export default Machines;
